  \"2013-03-15T05:59:53.558672\",\n\t\"name\": \"gulf-wide-information-system-environmental-sensitivity-index-shorebird-database-geographic-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for shorebird species in coastal Louisiana. Vector polygons represent
  concentration areas and \"hotspots\" for migratory shorebirds. Several nesting locations
  for certain resident species are also depicted. Species-specific abundance, seasonality,
  status, life history, and source information are stored in relational data tables
  (described below) designed to be used in conjunction with this spatial data layer.
  This data set comprises a portion of the Gulf-Wide Information System (G-WIS) database
  for the entire coastal zone of Louisiana. The G-WIS data include three main components:
  shoreline habitats, sensitive biological resources, and human-use resources. See
  also the W_FOWL, NESTS, and NHP data layers, part of the larger Louisiana G-WIS
  database, for additional bird information.\",\n\t\"license_title\": null,\n\t\"extras\":
